import "./App.css";
import "./css/bootstrap.min.css";
import {
  BrowserRouter as Router,
  Link,
  Route,
  Switch,
  Redirect,
} from "react-router-dom";
class App extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      isAuth: false,
    };
  }

  render() {
    return (
      <Router>
        <div>
          <ul style={{ listStyle: none }}>
            <li>
              <Link to='/'> Home</Link>
            </li>
            <li>
              <Link to='/news'> News</Link>
            </li>
            <li>
              <Link to='/profile'> Profile</Link>
            </li>
          </ul>

          <Switch>
            <Route
              path='/'
              exact
              render={() => <div>Ini adalah halaman Home</div>}></Route>
            <Route
              path='/News'
              exact
              render={() => <div>Ini adalah halaman News</div>}></Route>
          </Switch>
        </div>
      </Router>
    );
  }
}

export default App;
